import React from "react";
import "./App.scss";
import logo from "./images/logo_pineapple.png";

function App() {
  return (
    <div className="App">
      <header className="navbar">
        <div className="logo">
          <a href="/">
            <img src={logo} alt="logo" />
          </a>
        </div>
        <nav>
          <ul> (li>a*3)
          </ul>
        </nav>
      </header>
    </div>
  );
}

export default App;
